import{_ as e,o as a,c as o,O as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 19.2-392.14 (For contingent effective date see Acts 2021, Sp. Sess. I, cc. 524 and 542) Disclosure of sealed records; penalty.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-392.14.md","filePath":"vacode/19.2-392.14.md"}'),r={name:"vacode/19.2-392.14.md"},s=t('<h1 id="§-19-2-392-14-for-contingent-effective-date-see-acts-2021-sp-sess-i-cc-524-and-542-disclosure-of-sealed-records-penalty" tabindex="-1">§ 19.2-392.14 (For contingent effective date see Acts 2021, Sp. Sess. I, cc. 524 and 542) Disclosure of sealed records; penalty. <a class="header-anchor" href="#§-19-2-392-14-for-contingent-effective-date-see-acts-2021-sp-sess-i-cc-524-and-542-disclosure-of-sealed-records-penalty" aria-label="Permalink to &quot;§ 19.2-392.14 (For contingent effective date see Acts 2021, Sp. Sess. I, cc. 524 and 542) Disclosure of sealed records; penalty.&quot;">​</a></h1><p>A. It is unlawful for any person having or acquiring access to sealed criminal history record information or a court record, including any records relating to an arrest, charge, or conviction, that was ordered to be sealed pursuant to § <a href="/vacode/19.2-392.7/">19.2-392.7</a>, <a href="/vacode/19.2-392.8/">19.2-392.8</a>, <a href="/vacode/19.2-392.9/">19.2-392.9</a>, <a href="/vacode/19.2-392.11/">19.2-392.11</a>, or <a href="/vacode/19.2-392.12/">19.2-392.12</a>, to disclose such record or any information from such record to another person, except in accordance with the purposes set forth in § <a href="/vacode/19.2-392.13/">19.2-392.13</a> and pursuant to the rules and regulations adopted pursuant to § <a href="/vacode/9.1-128/">9.1-128</a> and the procedures adopted pursuant to § <a href="/vacode/9.1-134/">9.1-134</a>.</p><p>B. A clerk of court shall not be in violation of this section if such clerk informs a person requesting access to a sealed court record that such court record has been sealed and can only be accessed pursuant to a court order.</p><p>C. Any person who willfully violates this section is guilty of a Class 1 misdemeanor. Any person who maliciously and intentionally violates this section is guilty of a Class 6 felony.</p><p>2021, Sp. Sess. I, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0524" target="_blank" rel="noreferrer">524</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0542" target="_blank" rel="noreferrer">542</a>.</p>',5),c=[s];function n(i,d,l,f,p,u){return a(),o("div",null,c)}const v=e(r,[["render",n]]);export{_ as __pageData,v as default};
